                  'Content-Type': 'application/json'
                },
                body: JSON.stringify({username: token[0].user})
            }).then((res) => {
                if (res.status === 200) {
                    setTrips([{'id': 1, 'name': 'trip1'}, {'id': 2, 'name': 'trip2'}]);
                }
            });
        }
    }, []);*/

    if (!token) {
        alert("You need to log in first.");
        return(
            <Navigate to='/login' />
